import dataM from '../data/gogungCategory.json';

function Main(){
    const http = dataM.http;

    return(
        <>
            <div>
                <div className='slide-wrap' >
                    <div className='slide-content'>
                        {dataM.gogung.map((v,k)=>(
                            <p key={k}><img src={v.imgUrl} alt={k} key={k}/></p>
                        ))}
                    </div>
                </div>
            </div>
        </>
    );
}
export default Main;
